import React from 'react'
import { useState } from 'react'
import Table from 'react-bootstrap/Table'
import Axios from 'axios'

const UsersPage = () => {
    const [users, setUsers] = useState([]);

    const getUsers = () => {
        Axios.get('http://localhost:3000/users')
    }

    return (
        <Table className='display-flex justify-content-center'>
            <thead>
                <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Address</th>
                    <th>Bill</th>
                </tr>
            </thead>
            <tbody>
                {users.map((userData) => {
                    return <tr>
                        <td>{userData.id}</td>
                        <td>{userData.name}</td>
                        <td>{userData.bill}</td>
                        <td>{userData.paidBool}</td>
                    </tr>
                })}
            </tbody>
        </Table>
    )
}

export default UsersPage
